import React from "react";

const Card = (props) => {
    return (
      <div style={{margin: "1em"}}>
          <img width="75" src="https://avatars3.githubusercontent.com/u/17371652"></img>
          <div style={{display:'inline-block', marginleft:10}}>
              <div style={{fontsize: '1.25em',}}>Name here..</div>
              <div>Companey Name here..</div>
          </div>
      </div>
    );
}

const CardList = (props) => {
    return (
        <Card/>
    )
}

export default Card;
